INSERT INTO `blog` (`blog_id`, `category_id`, `blog_title`, `blog_title_ab`, `blog_title_he`, `short_content`, `short_content_ab`, `short_content_he`, `blog_content`, `blog_content_ab`, `blog_content_he`, `status`, `blog_like_count`, `blog_unlike_count`, `created_at`, `updated_at`) VALUES
(13, 9, 'More visual ways to shop', 'المزيد من الطرق المرئية للتسوق', 'דרכים חזותיות יותר לחנות', 'More visual ways to shop', 'דרכים חזותיות יותר לחנות', 'المزيد من الطرق المرئية للتسوق', '<p><img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666087775Blog_Post_Hero_Image_gImbPzT.max-1000x1000.png\" style=\"border-style:solid; border-width:5px; height:282px; margin:12px 250px; width:500px\" />Today we&rsquo;re introducing a new way to unlock the shopping experience on Google. In the U.S., when you search the word&nbsp;<em>&ldquo;</em>shop&rdquo; followed by whatever item you&#39;re looking for, you&rsquo;ll access a visual feed of products, research tools and nearby inventory related to that product. We&rsquo;re also expanding the&nbsp;<a href=\"https://blog.google/products/shopping/search-on-2021-shopping/\">shoppable search experience</a>&nbsp;beyond apparel to all categories &mdash; from electronics to beauty &mdash; and more regions on mobile (and coming soon to desktop).</p>\r\n\r\n<p>&nbsp;</p>', '<pre>\r\nنقدم اليوم طريقة جديدة لإطلاق العنان لتجربة التسوق على Google. في الولايات المتحدة ، عندما تبحث عن كلمة &quot;متجر&quot; متبوعة بأي عنصر تبحث عنه ، ستتمكن من الوصول إلى موجز مرئي للمنتجات وأدوات البحث والمخزون القريب المرتبط بهذا المنتج. نعمل أيضًا على توسيع نطاق تجربة البحث القابلة للتسوّق بما يتجاوز الملابس لتشمل جميع الفئات - من الإلكترونيات إلى مستحضرات التجميل - والمزيد من المناطق على الجوّال (وقريبًا على أجهزة الكمبيوتر المكتبية).</pre>', '<pre>\r\nהיום אנחנו מציגים דרך חדשה לפתוח את חווית הקנייה ב-Google. בארה&quot;ב, כשאתה מחפש את המילה &quot;חנות&quot; ואחריה כל פריט שאתה מחפש, תקבל גישה לעדכון חזותי של מוצרים, כלי מחקר ומלאי קרוב הקשור למוצר זה. אנחנו גם מרחיבים את חוויית החיפוש הניתנת לקניה מעבר ללבוש לכל הקטגוריות - מאלקטרוניקה ועד יופי - ולאזורים נוספים בנייד (ובקרוב יגיע למחשב שולחני).</pre>', 1, 1, 0, '2022-10-18 09:29:08', '2022-12-02 10:00:20'),
(14, 14, 'Cafe hopping in Noida', 'مقهى التنقل في نويدا', 'בית קפה שופינג בנוידה', 'Noida might be a paradise for home buyers but it still needs to go a long way for becoming a foodie’s haven.', 'لقليلة في نويدا تستحق الزيارة حقًا. سوق القطاع -18 في نويدا والذي يصادف أن يكون مركزًا', 'ך לגן עדן של אוכלים. למרות מיעוט האפשרויות, בתי הקפה המעטים האלה בנוידה', '<p><a href=\"https://timesofindia.indiatimes.com/travel/Noida/travel-guide/cs49520386.cms\">Noida</a>&nbsp;might be a paradise for home buyers but it still needs to go a long way for becoming a foodie&rsquo;s haven. Despite the paucity of choices, these handful cafes in Noida are really worth visiting. The sector-18 market of Noida which happens to be a commercial hub, has a few leading joints, which are identifiable favourites. Take&nbsp;<a href=\"https://timesofindia.indiatimes.com/travel/Mumbai/travel-guide/cs23958811.cms\">Mumbai</a>&nbsp;Matinee with its alluring typical Bollywood setting or the Paddy&rsquo;s Cafe that is frequented by office-goers looking for a quick time-out with their buddies. Notable in its contemporary charm, the Burbee&rsquo;s Cafe wins the heart of youth whereas Theos and Kaffiiaa offer respite from cheap Italian versions of pizzas and pastas <img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666088506download (1)1.jpg\" style=\"border-style:solid; border-width:5px; height:168px; margin-left:250px; margin-right:250px; width:300px\" />.</p>', '<pre>\r\nقد تكون نويدا جنة لمشتري المنازل ولكنها لا تزال بحاجة إلى قطع شوط طويل لتصبح ملاذًا لعشاق الطعام. على الرغم من ندرة الخيارات ، فإن هذه المقاهي القليلة في نويدا تستحق الزيارة حقًا. سوق القطاع -18 في نويدا والذي يصادف أن يكون مركزًا تجاريًا ، يحتوي على عدد قليل من المفاصل الرائدة ، والتي يمكن تحديدها المفضلة. خذ مومباي ماتيني مع أجواء بوليوود النموذجية الجذابة أو مقهى بادي الذي يتردد عليه رواد المكتب الذين يبحثون عن قضاء وقت سريع مع رفاقهم. يجذب مقهى Burbee ، الذي يتميز بسحره المعاصر ، قلب الشباب بينما يقدم Theos و Kaffiiaa فترة راحة من الإصدارات الإيطالية الرخيصة من البيتزا والباستا.<img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666088506download (1)1.jpg\" style=\"border-style:solid; border-width:5px; height:168px; margin-left:250px; margin-right:250px; width:300px\" /></pre>', '<pre>\r\nנוידה עשויה להיות גן עדן לרוכשי בתים, אבל היא עדיין צריכה לעבור דרך ארוכה כדי להפוך לגן עדן של אוכלים. למרות מיעוט האפשרויות, בתי הקפה המעטים האלה בנוידה באמת שווים ביקור. לשוק הסקטור 18 של נוידה, שהוא במקרה מרכז מסחרי, יש כמה ג&#39;וינטים מובילים, שהם מועדפים שניתן לזהות. קחו את&nbsp;Mumbai&nbsp;Matinee עם התפאורה הבוליוודית המושכת שלו או את פאדי&#39;ס קפה שפוקדים אותו אנשי משרד שמחפשים פסק זמן מהיר עם חבריהם. בולט בקסמו העכשווי, בית הקפה Burbee&#39;s מנצח את לב הנעורים ואילו תיאוס וקאפיה מציעים הפוגה מגרסאות איטלקיות זולות של פיצות ופסטות.<img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666088506download (1)1.jpg\" style=\"border-style:solid; border-width:5px; height:168px; margin-left:250px; margin-right:250px; width:300px\" /></pre>', 1, 0, 2, '2022-10-18 10:22:28', '2022-12-02 10:22:09'),
(17, 14, 'Coffee', 'قهوة', 'קפה', 'Coffee is a drink prepared from roasted coffee beans. Darkly colored, bitter, and slightly acidic, coffee has a stimulating effect on humans, primarily due to its caffeine content. It is the most popular hot drink in the world.', 'القهوة مشروب معد من حبوب البن المحمصة. القهوة ذات الألوان الداكنة والمرة والحمضية قليلاً لها تأثير محفز على البشر ، ويرجع ذلك أساسًا إلى محتواها من الكافيين. إنه المشروب الساخن الأكثر شعبية في العالم.', 'קפה הוא משקה המוכן מפולי קפה קלויים. לקפה בעל צבע כהה, מר ומעט חומצי, יש השפעה מעוררת על בני אדם, בעיקר בשל תכולת הקפאין שלו. זהו המשקה החם הפופולרי ביותר בעולם.', '<p><strong>Coffee</strong>&nbsp;is a drink prepared from roasted&nbsp;<a href=\"https://en.wikipedia.org/wiki/Coffee_bean\">coffee beans</a>. Darkly colored, bitter, and slightly&nbsp;<a href=\"https://en.wikipedia.org/wiki/Acid\">acidic</a>, coffee has a&nbsp;<a href=\"https://en.wikipedia.org/wiki/Stimulant\">stimulating</a>&nbsp;effect on humans, primarily due to its&nbsp;<a href=\"https://en.wikipedia.org/wiki/Caffeine\">caffeine</a>&nbsp;content. It is the most popular hot drink in the world.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Seeds of the&nbsp;<em><a href=\"https://en.wikipedia.org/wiki/Coffea\">Coffea</a></em>&nbsp;plant&#39;s fruits are separated to produce unroasted green coffee beans. The beans are&nbsp;<a href=\"https://en.wikipedia.org/wiki/Coffee_roasting\">roasted</a>&nbsp;and then ground into fine particles that are typically steeped in hot water before being filtered out, producing a cup of coffee. It is usually served hot, although chilled or&nbsp;<a href=\"https://en.wikipedia.org/wiki/Iced_coffee\">iced coffee</a>&nbsp;is common. Coffee can be prepared and presented in a variety of ways (e.g.,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Espresso\">espresso</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/French_press\">French press</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Caff%C3%A8_latte\">caff&egrave; latte</a>, or already-brewed&nbsp;<a href=\"https://en.wikipedia.org/wiki/Canned_coffee\">canned coffee</a>).&nbsp;<a href=\"https://en.wikipedia.org/wiki/Sugar\">Sugar</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Sugar_substitute\">sugar substitutes</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Milk\">milk</a>, and&nbsp;<a href=\"https://en.wikipedia.org/wiki/Cream\">cream</a>&nbsp;are often used to lessen the bitter taste or enhance the flavor.<img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666095534download (6).jpg\" style=\"border-style:solid; border-width:5px; height:194px; margin:5px 250px; width:259px\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666095705download (7).jpg\" style=\"border-style:solid; border-width:5px; height:183px; margin-left:250px; margin-right:250px; width:275px\" /></p>', '<pre>\r\nالقهوة مشروب معد من حبوب البن المحمصة. القهوة ذات الألوان الداكنة والمرة والحمضية قليلاً لها تأثير محفز على البشر ، ويرجع ذلك أساسًا إلى محتواها من الكافيين. إنه المشروب الساخن الأكثر شعبية في العالم. [3] يتم فصل بذور ثمار نبات القهوة لإنتاج حبوب البن الخضراء غير المحمصة. يتم تحميص الحبوب ثم طحنها إلى جزيئات دقيقة تُنقع عادةً في الماء الساخن قبل تصفيتها لإنتاج فنجان من القهوة. عادة ما يتم تقديمه ساخنًا ، على الرغم من أن القهوة المثلجة أو المثلجة شائعة. يمكن تحضير القهوة وتقديمها بعدة طرق (على سبيل المثال ، إسبرسو أو فرنش برس أو كافيه لاتيه أو قهوة معلبة بالفعل). غالبًا ما يستخدم السكر وبدائل السكر والحليب والقشدة لتقليل الطعم المر أو تحسين النكهة.<img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666095705download (7).jpg\" style=\"border-style:solid; border-width:5px; height:183px; margin-left:250px; margin-right:250px; width:275px\" /><img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666095584download (6).jpg\" style=\"border-style:solid; border-width:5px; height:194px; margin:5px 250px; width:259px\" /></pre>', '<pre>\r\nקפה&nbsp;הוא משקה המוכן מפולי&nbsp;קפה קלויים. לקפה בעל צבע כהה, מר ומעט חומצי, יש השפעה מעוררת על בני אדם, בעיקר בשל תכולת הקפאין שלו. זהו המשקה החם הפופולרי ביותר בעולם.[3] זרעים של פירות צמח הקפה מופרדים כדי לייצר פולי קפה ירוקים לא קלויים. הפולים&nbsp;נקלים&nbsp;ולאחר מכן טוחנים לחלקיקים עדינים שבדרך כלל ספוגים במים חמים לפני שהם מסוננים, ומייצרים כוס קפה. הוא מוגש בדרך כלל חם, אם כי קפה צונן או קר&nbsp;נפוץ. ניתן להכין ולהגיש קפה במגוון דרכים (למשל, אספרסו, עיתונות צרפתית, קפה לאטה או קפה שימורים שכבר מבושל). סוכר, תחליפי סוכר, חלב ושמנת משמשים לעתים קרובות כדי להפחית את הטעם המר או לשפר את הטעם.<img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666095584download (6).jpg\" style=\"border-style:solid; border-width:5px; height:194px; margin:5px 250px; width:259px\" /><img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666095705download (7).jpg\" style=\"border-style:solid; border-width:5px; height:183px; margin-left:250px; margin-right:250px; width:275px\" /></pre>', 1, 0, 3, '2022-10-18 12:20:34', '2022-12-02 10:22:15'),
(18, 14, '9 Unique Benefits of Coffee', '9 فوائد فريدة للقهوة', '9 יתרונות ייחודיים של קפה', 'Coffee is a beloved beverage known for its ability to fine-tune your focus and boost your energy levels.', 'القهوة مشروب محبوب معروف بقدرته على ضبط تركيزك وزيادة مستويات الطاقة لديك.', 'קפה הוא משקה אהוב הידוע ביכולתו לכוונן את המיקוד שלך ולהגביר את רמות האנרגיה שלך.', '<p>Coffee is a beloved beverage known for its ability to fine-tune your focus and boost your energy levels.</p>\r\n\r\n<p>In fact, many people depend on their daily cup of joy&nbsp;right when they wake up to get their day started on the right foot.</p>\r\n\r\n<p>In addition to its energizing effects, coffee has been linked to a long list of potential health benefits, giving you all the more reason to get brewing.</p>\r\n\r\n<p>This article takes an in-depth look at 9 of the top evidence-based benefits of coffee.</p>\r\n\r\n<p>Share on Pinterest</p>\r\n\r\n<p><img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666096954download (5).jpg\" style=\"border-style:solid; border-width:5px; height:163px; margin-bottom:5px; margin-top:5px; width:310px\" /><img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666097062Latte_and_dark_coffee.jpg\" style=\"border-style:solid; border-width:5px; height:163px; width:310px\" /></p>\r\n\r\n<p>&nbsp;</p>', '<pre>\r\nالقهوة مشروب محبوب معروف بقدرته على ضبط تركيزك وزيادة مستويات الطاقة لديك.\r\n\r\nفي الواقع ، يعتمد الكثير من الناس على فنجان الفرح اليومي عندما يستيقظون ليبدأوا يومهم بالقدم اليمنى.\r\n\r\nبالإضافة إلى تأثيرات القهوة المنشطة ، فقد تم ربط القهوة بقائمة طويلة من الفوائد الصحية المحتملة ، مما يمنحك سببًا إضافيًا للتخمير.\r\n\r\nتلقي هذه المقالة نظرة متعمقة على 9 من أهم فوائد القهوة القائمة على الأدلة.\r\n\r\nانشر على موقع Pinterest</pre>', '<pre>\r\nקפה הוא משקה אהוב הידוע ביכולתו לכוונן את המיקוד שלך ולהגביר את רמות האנרגיה שלך.\r\n\r\nלמעשה, אנשים רבים תלויים בכוס השמחה היומית שלהם ממש כשהם מתעוררים כדי להתחיל את היום ברגל ימין.\r\n\r\nבנוסף להשפעותיו הממריצות, קפה נקשר לרשימה ארוכה של יתרונות בריאותיים פוטנציאליים, מה שנותן לך עוד יותר סיבה להתבשל.\r\n\r\nמאמר זה בוחן לעומק 9 מהיתרונות העיקריים המבוססים על ראיות של קפה.\r\n\r\nשתפו בפינטרסט</pre>', 1, 0, 3, '2022-10-18 12:44:52', '2022-12-02 10:22:20'),
(19, 10, 'The 10 Best Breakfast Restaurants in New Orleans', 'أفضل 10 مطاعم للإفطار في نيو أورلينز', '10 מסעדות ארוחת הבוקר הטובות ביותר בניו אורלינס', 'You may know New Orleans for its wild nightlife, but have you heard about The Big Easy\'s signature breakfast? Whether you want to cure your hangover (or add to it) there are plenty of options available in New Orleans.', 'قد تعرف نيو أورلينز بحياتها الليلية الصاخبة ، لكن هل سمعت عن إفطار The Big Easy المميز؟ سواء كنت ترغب في علاج مخلفاتك (أو الإضافة إليها) ، فهناك الكثير من الخيارات المتاحة في نيو أورلينز.', 'אתם אולי מכירים את ניו אורלינס בזכות חיי הלילה הפרועים שלה, אבל האם שמעתם על ארוחת הבוקר המיוחדת של The Big Easy? בין אם אתה רוצה לרפא את ההנגאובר שלך (או להוסיף לו) יש הרבה אפשרויות זמינות בניו אורלינס.', '<p>You may know New Orleans for its wild nightlife, but have you heard about The Big Easy&#39;s signature breakfast? Whether you want to cure your hangover (or add to it) there are plenty of options available in New Orleans. From classic to historical to unique, there is a breakfast option for all. We have hole-in-the-walls and famous, widely-known breakfast venues. You want it, we got it! a<br />\r\n<br />\r\nAt the Degas House bed and breakfast, we proudly give people an authentic New Orleans cultural experience. If you&#39;re looking for a vintage, beautiful place to stay, <a href=\"https://www.degashouse.com/accommodations.html\" target=\"_self\">we cannot recommend our rooms enough.&nbsp;</a>&nbsp;That being said, and wherever you say, we want to make sure you treat yourself from the moment you get up. Nothing is better than starting the day off with a delicious meal and a steaming cup of coffee. It&#39;s time for you to taste the best that New Orleans has to offer.<br />\r\n<img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666352106download (1)12.jpg\" style=\"border-style:solid; border-width:5px; height:159px; margin-left:250px; margin-right:250px; width:318px\" /></p>', '<pre>\r\nقد تعرف نيو أورلينز بحياتها الليلية الصاخبة ، لكن هل سمعت عن إفطار The Big Easy المميز؟ سواء كنت ترغب في علاج صداع الكحول (أو الإضافة إليه) ، فهناك الكثير من الخيارات المتاحة في نيو أورلينز. من الكلاسيكي إلى التاريخي إلى الفريد ، هناك خيار إفطار للجميع. لدينا حفرة في الجدران وأماكن إفطار شهيرة ومعروفة على نطاق واسع. كنت ترغب في ذلك، وحصلنا على ذلك!\r\n\r\nفي مبيت وإفطار Degas House ، نقدم بكل فخر للناس تجربة ثقافية أصيلة في نيو أورلينز. إذا كنت تبحث عن مكان عتيق وجميل للإقامة ، فلا يمكننا التوصية بغرفنا بدرجة كافية. بعد قولي هذا ، وأينما قلت ، نريد أن نتأكد من أنك تعامل نفسك منذ اللحظة التي تستيقظ فيها. لا شيء أفضل من بدء اليوم بوجبة لذيذة وفنجان من القهوة على البخار. حان الوقت لتذوق أفضل ما تقدمه نيو أورلينز.<img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666352106download (1)12.jpg\" style=\"border-style:solid; border-width:5px; height:159px; margin-left:250px; margin-right:250px; width:318px\" /></pre>', '<pre>\r\nאתם אולי מכירים את ניו אורלינס בזכות חיי הלילה הפרועים שלה, אבל האם שמעתם על ארוחת הבוקר המיוחדת של The Big Easy? בין אם אתה רוצה לרפא את ההנגאובר שלך (או להוסיף לו) יש הרבה אפשרויות זמינות בניו אורלינס. מקלאסי להיסטורי ועד ייחודי, ישנה אפשרות לארוחת בוקר לכולם. יש לנו חור בקירות ומקומות ארוחות בוקר מפורסמים ומוכרים. אתה רוצה את זה, הבנו את זה!\r\n\r\nב-Degas House B&amp;B, אנו בגאווה נותנים לאנשים חוויה תרבותית אותנטית בניו אורלינס. אם אתם מחפשים מקום וינטג&#39; ויפה לשהות בו, אנחנו לא יכולים להמליץ ​​מספיק על החדרים שלנו. עם זאת נאמר, ובכל מקום שתאמר, אנחנו רוצים לוודא שאתה מטפל בעצמך מהרגע שאתה קם. אין דבר טוב יותר מאשר להתחיל את היום עם ארוחה טעימה וכוס קפה מהביל. הגיע הזמן שתטעמו מהטוב ביותר שיש לניו אורלינס להציע.<img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666352106download (1)12.jpg\" style=\"border-style:solid; border-width:5px; height:159px; margin-left:250px; margin-right:250px; width:318px\" /></pre>', 1, 3, 0, '2022-10-21 11:35:56', '2022-12-02 10:22:04'),
(20, 15, 'T20 World Cup 2022: The saga of unsavoury India-Bangladesh matches continues', 'كأس العالم T20 2022: تستمر ملحمة المباريات البغيضة بين الهند وبنجلاديش', 'גביע העולם T20 2022: סאגת המשחקים הלא טעימים של הודו-בנגלדש נמשכת', 'Virat Kohli played only four innings last month but he churned out three memorable knocks, including a magical 82* against Pakistan in the T20 World Cup.', 'لعب فيرات كوهلي أربع جولات فقط الشهر الماضي ، لكنه تسبب في ثلاث ضربات لا تنسى ، بما في ذلك 82 * السحرية ضد باكستان في كأس العالم T20.', 'וירט קוהלי שיחק רק ארבעה סיבובים בחודש שעבר, אבל הוא הוציא שלוש דפיקות בלתי נשכחות, כולל 82* קסום מול פקיסטן בגביע העולם T20.', '<p>As admitted by Kohli himself, it was the best T20I knock he has ever played. India looked down and out of the contest when they were reduced to 31/4 while chasing 160, but Kohli stepped up and played a match-winning hand of 82* from just 53 deliveries to guide them home.&nbsp;</p>\r\n\r\n<p>Apart from that, the 33-year-old also played an excellent knock of 49* from just 28 deliveries against South Africa in Guwahati towards the start of the month. He also followed up his majestic knock against Pakistan in the T20 World Cup with another composed 62* from 44 deliveries against Netherlands. His only blip came in Perth when he was dismissed for just 12 against South Africa.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1667541072download (1).jpg\" style=\"border-style:solid; border-width:5px; height:168px; width:300px\" /></p>', '<pre>\r\nكما اعترف كوهلي نفسه ، كانت أفضل ضربة في T20I لعبها على الإطلاق. نظرت الهند إلى أسفل وخرجت من المسابقة عندما تم تخفيضها إلى 31/4 أثناء مطاردة 160 ، لكن كوهلي صعد ولعب توزيع الورق 82 * من 53 تسليم فقط لإرشادهم إلى المنزل.\r\n\r\nبصرف النظر عن ذلك ، لعب اللاعب البالغ من العمر 33 عامًا ضربة ممتازة بلغت 49 * من 28 مرة فقط ضد جنوب إفريقيا في جواهاتي في بداية الشهر. كما تابع ضربته المهيبة ضد باكستان في كأس العالم T20 بأخرى مؤلفة 62 * من 44 تسليم ضد هولندا. وجاءت الومضة الضوئية الوحيدة في بيرث عندما تم طرده لمدة 12 مرة فقط ضد جنوب إفريقيا.</pre>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1667541072download (1).jpg\" style=\"border-style:solid; border-width:5px; height:168px; width:300px\" /></p>', '<pre>\r\nכפי שהודה קוהלי עצמו, זה היה הנגיחה הטובה ביותר ב-T20I שהוא שיחק אי פעם. הודו השפילה מבט ומחוץ לתחרות כשהיא הצטמצמה ל-31/4 בעודה רודפת אחרי 160, אבל קוהלי התגבר ושיחק יד מנצחת של 82* מ-53 מסירות בלבד כדי להדריך אותם הביתה.\r\n\r\nמלבד זאת, השחקן בן ה-33 גם שיחק נגיחה מצוינת של 49* מ-28 מסירות בלבד מול דרום אפריקה בגוואהאטי לקראת תחילת החודש. הוא גם עקב אחר הדפיקה המלכותית שלו מול פקיסטן בגביע העולם T20 עם עוד 62* מ-44 מסירות מול הולנד. הבליפ היחיד שלו הגיע בפרת&#39; כשהודח ב-12 בלבד מול דרום אפריקה.</pre>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1667541072download (1).jpg\" style=\"border-style:solid; border-width:5px; height:168px; width:300px\" /></p>', 1, 0, 2, '2022-11-04 05:52:06', '2022-12-02 10:22:26'),
