ers\\&quot;) can register on the website and share content, videos, coupons, etc. (hereinafter: \\&quot;the information\\&quot;).general: &bull; Browsing the website is subject to the conditions detailed in these regulations and terms of use (\\&quot;the regulations\\&quot;). Please read the regulations carefully, as browsing the site and performing actions on it indicate your agreement to the terms contained in the regulations. Also, the website reserves the right to change the terms and conditions, from time to time, at its sole discretion and without prior notice. The date of application of the said change will be from the moment of its publication on the website. &bull; What is stated in these regulations refers equally to members of both genders and the use of masculine or feminine language is for convenience only. &bull; The terms of the regulations apply to the use of the site and the contents contained therein through any computer or other communication device (such as a cell phone, tablet computers, etc.). They also apply to the use of the site, either through the Internet or through any network or other means of communication. &bull; Browsing the site is allowed at any age. The purchase on the website is intended for those with legal capacity over the age of 18 only. A purchase by a minor under the age of 18 requires the approval of a parent or guardian. &bull; In the event that it is determined that a provision in these regulations is unenforceable or invalid for any reason, this will not affect or harm the legality, validity and enforcement of the other provisions of the regulations. &bull; Browsing the website: &bull; Browsing the site and perusing it do not require registration, and it is open to any surfer. &bull; When leaving details and/or making a purchase on the site, the surfer will be asked to provide personal details such as: first name, last name, telephone as well as an active e-mail address (at the site&#39;s discretion). Providing incomplet