(34, 'Cafe hopping in Noida', 'مقهى التنقل في نويدا', 'בית קפה שופינג בנוידה', 'Cafe hopping in NoidaCafe hopping in NoidaCafe hopping in NoidaCafe hopping in Noida', 'مقهى التنقل في نويدامقهى التنقل في نويدامقهى التنقل في نويدامقهى التنقل في نويدا', 'בית קפה שופינג בנוידהבית קפה שופינג בנוידהבית קפה שופינג בנוידה', '<p><a href=\"https://timesofindia.indiatimes.com/travel/Noida/travel-guide/cs49520386.cms\">Noida</a>&nbsp;might be a paradise for home buyers but it still needs to go a long way for becoming a foodie&rsquo;s haven. Despite the paucity of choices, these handful cafes in Noida are really worth visiting. The sector-18 market of Noida which happens to be a commercial hub, has a few leading joints, which are identifiable favourites. Take&nbsp;<a href=\"https://timesofindia.indiatimes.com/travel/Mumbai/travel-guide/cs23958811.cms\">Mumbai</a>&nbsp;Matinee with its alluring typical Bollywood setting or the Paddy&rsquo;s Cafe that is frequented by office-goers looking for a quick time-out with their buddies. Notable in its contemporary charm, the Burbee&rsquo;s Cafe wins the heart of youth whereas Theos and Kaffiiaa offer respite from cheap Italian versions of pizzas and pastas&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666088776download (1)1.jpg\" style=\"border-style:solid; border-width:5px; height:150px; margin:10px 50px; width:300px\" />&nbsp;<img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666088840download (1)12.jpg\" style=\"border-style:solid; border-width:5px; height:150px; margin-bottom:10px; margin-top:10px; width:300px\" /></p>', '<p>قد تكون نويدا جنة لمشتري المنازل ولكنها لا تزال بحاجة إلى قطع شوط طويل لتصبح ملاذًا لعشاق الطعام. على الرغم من ندرة الخيارات ، فإن هذه المقاهي القليلة في نويدا تستحق الزيارة حقًا. سوق القطاع -18 في نويدا والذي يصادف أن يكون مركزًا تجاريًا ، يحتوي على عدد قليل من المفاصل الرائدة ، والتي يمكن تحديدها المفضلة. خذ مومباي ماتيني مع أجواء بوليوود النموذجية الجذابة أو مقهى بادي الذي يتردد عليه رواد المكتب الذين يبحثون عن قضاء وقت سريع مع رفاقهم. يجذب مقهى Burbee ، الذي يتميز بسحره المعاصر ، قلب الشباب بينما يقدم Theos و Kaffiiaa فترة راحة من الإصدارات الإيطالية الرخيصة من البيتزا والباستا.</p>\r\n\r\n<p><img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666088776download (1)1.jpg\" style=\"border-style:solid; border-width:5px; height:150px; margin:10px 50px; width:300px\" /><img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666088840download (1)12.jpg\" style=\"border-style:solid; border-width:5px; height:150px; margin-bottom:10px; margin-top:10px; width:300px\" /></p>', '<pre>\r\nנוידה עשויה להיות גן עדן לרוכשי בתים, אבל היא עדיין צריכה לעבור דרך ארוכה כדי להפוך לגן עדן של אוכלים. למרות מיעוט האפשרויות, בתי הקפה המעטים האלה בנוידה באמת שווים ביקור. לשוק הסקטור 18 של נוידה, שהוא במקרה מרכז מסחרי, יש כמה ג&#39;וינטים מובילים, שהם מועדפים שניתן לזהות. קחו את&nbsp;Mumbai&nbsp;Matinee עם התפאורה הבוליוודית המושכת שלו או את פאדי&#39;ס קפה שפוקדים אותו אנשי משרד שמחפשים פסק זמן מהיר עם חבריהם. בולט בקסמו העכשווי, בית הקפה Burbee&#39;s מנצח את לב הנעורים ואילו תיאוס וקאפיה מציעים הפוגה מגרסאות איטלקיות זולות של פיצות ופסטות.</pre>\r\n\r\n<p><img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666088776download (1)1.jpg\" style=\"border-style:solid; border-width:5px; height:150px; margin:10px 50px; width:300px\" /><img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666088840download (1)12.jpg\" style=\"border-style:solid; border-width:5px; height:150px; margin-bottom:10px; margin-top:10px; width:300px\" /></p>', 1, 0, 2, '2022-10-18 10:29:29', '2022-12-05 13:07:28'),
(36, 'Travel Around the World', 'السفر حول العالم', 'לטייל מסביב לעולם', 'Travel Around the World', 'السفر حول العالم', 'לטייל מסביב לעולם', '<p>Those in the U.S. will want an up-to-date driver&rsquo;s license because by Oct. 1, 2020, all U.S. residents traveling domestically must have identification compliant with the&nbsp;<a href=\"https://time.com/money/5094105/check-your-passports-expiration-date-now/\" target=\"_blank\">Real-ID Act</a>, which increased security requirements for state drivers licenses and ID cards. Residents in 24 states including Alaska, California, Idaho, Maine, Oregon and Washington have until Oct. 10, 2018 get a Real-ID compliant card, though states have the option to apply for exemptions through Oct. 1, 2020 when the last phase of the Real-ID Act is enforced, meaning residents in those states should regularly check the status of their IDs before flying. For travel outside of the U.S.,&nbsp;<a href=\"https://www.cbp.gov/travel/trusted-traveler-programs\" target=\"_blank\">passport cards</a>&nbsp;or&nbsp;<a href=\"https://www.cbp.gov/travel/trusted-traveler-programs\" target=\"_blank\">trusted traveler cards</a>&nbsp;can serve as documents at certain land and sea crossings. But you&rsquo;ll want to make sure you have a passport book if there&rsquo;s any chance you might leave or enter another country via plane, where passport cards won&rsquo;t work.Already have a passport? You&rsquo;ll want check if it&rsquo;s valid for at least six months after planned trips. That&rsquo;s because some countries like Thailand, Indonesia, Vietnam and Russia make this a requirement for entering their countries. Renewing a passport takes at least six to eight weeks through the mail, but those with proof of international travel (like a flight itinerary) can get an&nbsp;<a href=\"http://www.travelandleisure.com/travel-news/how-long-does-it-take-to-renew-a-passport\" target=\"_blank\">expedited passport renewal</a>&nbsp;for an additional $60 to the $110 fee and by visiting a passport center in person. International travel could also require a visa depending on the location and duration of your trip. Some countries have agreements in place that allow travelers to enter and leave visa free. For example, the&nbsp;<a href=\"https://ca.usembassy.gov/visas/\" target=\"_blank\">U.S. and Canada</a>&nbsp;don&rsquo;t require visas for travel (<a href=\"https://ca.usembassy.gov/visas/do-i-need-a-visa/\" target=\"_blank\">except in certain circumstances</a>), and&nbsp;<a href=\"https://ec.europa.eu/home-affairs/what-we-do/policies/borders-and-visas/visa-policy_en\" target=\"_blank\">Europe&rsquo;s 26 Schengen States</a>&nbsp;have a system where a visa issued by one of the 26 states typically allows travel throughout the others for up to 90 days.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1666092591download (1).jpg\" style=\"border-style:solid; border-width:5px; height:196px; width:257px\" /></p>', '<pre>\r\nسيحتاج المقيمون في الولايات المتحدة إلى رخصة قيادة محدثة لأنه بحلول 1 أكتوبر 2020 ، يجب أن يكون لدى جميع المقيمين في الولايات المتحدة الذين يسافرون محليًا بطاقات هوية متوافقة مع قانون الهوية الحقيقية ، مما زاد من متطلبات الأمان لرخص القيادة الحكومية وبطاقات الهوية.\r\n\r\nيحصل المقيمون في 24 ولاية بما في ذلك ألاسكا وكاليفورنيا وأيداهو ومين وأوريغون وواشنطن حتى 10 أكتوبر 2018 على بطاقة متوافقة مع الهوية الحقيقية ، على الرغم من أن الدول لديها خيار التقدم بطلب للحصول على إعفاءات حتى 1 أكتوبر 2020 عندما تكون المرحلة الأخيرة من قانون الهوية الحقيقية ، مما يعني أنه يجب على المقيمين في تلك الولايات التحقق بانتظام من حالة بطاقات الهوية الخاصة بهم قبل السفر بالطائرة.\r\n\r\nللسفر خارج الولايات المتحدة ، يمكن استخدام بطاقات جواز السفر أو بطاقات المسافر الموثوق بها كوثائق عند بعض المعابر البرية والبحرية. ولكن عليك التأكد من أن لديك دفتر جواز سفر إذا كانت هناك أي فرصة لمغادرة بلد آخر أو دخوله عبر الطائرة ، حيث لن تعمل بطاقات جواز السفر.\r\n\r\nهل لديك جواز سفر بالفعل؟ ستحتاج إلى التحقق مما إذا كانت صالحة لمدة ستة أشهر على الأقل بعد الرحلات المخطط لها. وذلك لأن بعض البلدان مثل تايلاند وإندونيسيا وفيتنام وروسيا تجعل هذا شرطًا لدخول بلادهم. يستغرق تجديد جواز السفر ما لا يقل عن ستة إلى ثمانية أسابيع عبر البريد ، ولكن أولئك الذين لديهم دليل على السفر الدولي (مثل خط سير الرحلة) يمكنهم الحصول على تجديد سريع لجواز السفر مقابل 60 دولارًا إضافيًا إلى رسوم 110 دولارًا وزيارة مركز الجوازات شخصيًا.\r\n\r\nقد يتطلب السفر الدولي أيضًا تأشيرة اعتمادًا على موقع ومدة رحلتك. بعض الدول لديها اتفاقيات سارية تسمح للمسافرين بالدخول والمغادرة بدون تأشيرة. على سبيل المثال ، لا تتطلب الولايات المتحدة وكندا تأشيرات للسفر (باستثناء ظروف معينة) ، ولدى 26 دولة من دول شنغن في أوروبا نظام تسمح فيه التأشيرة الصادرة عن إحدى الولايات الـ 26 بالسفر عبر الدول الأخرى لمدة تصل إلى 90 يومًا. .</pre>', '<pre>\r\nאלה בארה&quot;ב ירצו רישיון נהיגה עדכני מכיוון שעד 1 באוקטובר 2020, כל תושבי ארה&quot;ב הנוסעים מקומיים חייבים להיות בעלי זיהוי תואם לחוק ה-Real ID, שהגביר את דרישות האבטחה עבור רישיונות נהיגה ותעודות זהות של המדינה.\r\n\r\nתושבים ב-24 מדינות כולל אלסקה, קליפורניה, איידהו, מיין, אורגון וושינגטון יקבלו עד 10 באוקטובר 2018 כרטיס תואם Real-ID, אם כי למדינות יש אפשרות להגיש בקשה לפטור עד 1 באוקטובר 2020 כאשר השלב האחרון של חוק תעודת הזהות האמיתית נאכף, כלומר תושבים באותן מדינות צריכים לבדוק באופן קבוע את מצב תעודות הזהות שלהם לפני הטיסה.\r\n\r\nעבור נסיעות מחוץ לארה&quot;ב,&nbsp;כרטיסי דרכון&nbsp;או&nbsp;כרטיסי נוסע מהימנים&nbsp;יכולים לשמש כמסמכים במעברים יבשתיים וימיים מסוימים. אבל תרצה לוודא שיש לך פנקס דרכונים אם יש סיכוי שאתה עשוי לצאת או להיכנס למדינה אחרת באמצעות מטוס, שבה כרטיסי דרכונים לא יעבדו.\r\n\r\nיש כבר דרכון? תרצה לבדוק אם זה תקף לפחות שישה חודשים לאחר נסיעות מתוכננות. הסיבה לכך היא שמדינות מסוימות כמו תאילנד, אינדונזיה, וייטנאם ורוסיה מציבות זאת כדרישה לכניסה למדינות שלהן. חידוש דרכון נמשך לפחות שישה עד שמונה שבועות בדואר, אבל אלה עם הוכחה של נסיעה בינלאומית (כמו מסלול טיסה) יכולים לקבל&nbsp;חידוש דרכון מזורז&nbsp;בתוספת של $60 ל-$110 העמלה ועל ידי ביקור אישי במרכז דרכונים.\r\n\r\nנסיעות בינלאומיות עשויות לדרוש גם ויזה בהתאם למיקום ומשך הטיול שלך. לחלק מהמדינות יש הסכמים המאפשרים לנוסעים להיכנס ולצאת ללא ויזה. לדוגמה,&nbsp;ארה&quot;ב וקנדה&nbsp;אינן דורשות אשרות לנסיעות (למעט בנסיבות מסוימות), ול-26 מדינות שנגן של אירופה&nbsp;יש מערכת שבה ויזה שהונפקה על ידי אחת מ-26 המדינות מאפשרת בדרך כלל נסיעה במדינות האחרות למשך עד 90 יום .</pre>', 1, 0, 2, '2022-10-18 11:06:21', '2022-12-02 04:54:08'),
(41, 'The 10 Best Breakfast Restaurants in New Orleans', 'أفضل 10 مطاعم للإفطار في نيو أورلينز', '10 מסעדות ארוחת הבוקר הטובות ביותר בניו אורלינס', 'You may know New Orleans for its wild nightlife, but have you heard about The Big Easy\'s signature breakfast?', 'قد تعرف نيو أورلينز بحياتها الليلية الصاخبة ، لكن هل سمعت عن إفطار The Big Easy المميز؟', 'אתם אולי מכירים את ניו אורלינס בזכות חיי הלילה הפרועים שלה, אבל האם שמעתם על ארוחת הבוקר המיוחדת של The Big Easy?', '<p>You may know New Orleans for its wild nightlife, but have you heard about The Big Easy&#39;s signature breakfast? Whether you want to cure your hangover (or add to it) there are plenty of options available in New Orleans. From classic to historical to unique, there is a breakfast option for all. We have hole-in-the-walls and famous, widely-known breakfast venues. You want it, we got it!<br />\r\n<br />\r\nAt the Degas House bed and breakfast, we proudly give people an authentic New Orleans cultural experience. If you&#39;re looking for a vintage, beautiful place to stay, <a href=\"https://www.degashouse.com/accommodations.html\" target=\"_self\">we cannot recommend our rooms enough.&nbsp;</a>&nbsp;That being said, and wherever you say, we want to make sure you treat yourself from the moment you get up. Nothing is better than starting the day off with a delicious meal and a steaming cup of coffee. It&#39;s time for you to taste the best that New Orleans has to offer.<br />\r\n&nbsp;</p>', '<pre>\r\nقد تعرف نيو أورلينز بحياتها الليلية الصاخبة ، لكن هل سمعت عن إفطار The Big Easy المميز؟ سواء كنت ترغب في علاج مخلفاتك (أو الإضافة إليها) ، فهناك الكثير من الخيارات المتاحة في نيو أورلينز. من الكلاسيكي إلى التاريخي إلى الفريد ، هناك خيار إفطار للجميع. لدينا حفرة في الجدران وأماكن إفطار شهيرة ومعروفة على نطاق واسع. كنت ترغب في ذلك، وحصلنا على ذلك!\r\n\r\nفي مبيت وإفطار Degas House ، نقدم بكل فخر للناس تجربة ثقافية أصيلة في نيو أورلينز. إذا كنت تبحث عن مكان عتيق وجميل للإقامة ، فلا يمكننا التوصية بغرفنا بدرجة كافية. بعد قولي هذا ، وأينما قلت ، نريد أن نتأكد من أنك تعامل نفسك منذ اللحظة التي تستيقظ فيها. لا شيء أفضل من بدء اليوم بوجبة لذيذة وفنجان من القهوة على البخار. حان الوقت لتذوق أفضل ما تقدمه نيو أورلينز.</pre>', '<pre>\r\nאתם אולי מכירים את ניו אורלינס בזכות חיי הלילה הפרועים שלה, אבל האם שמעתם על ארוחת הבוקר המיוחדת של The Big Easy? בין אם אתה רוצה לרפא את ההנגאובר שלך (או להוסיף לו) יש הרבה אפשרויות זמינות בניו אורלינס. מקלאסי להיסטורי ועד ייחודי, ישנה אפשרות לארוחת בוקר לכולם. יש לנו חור בקירות ומקומות ארוחות בוקר מפורסמים ומוכרים. אתה רוצה את זה, הבנו את זה!\r\n\r\nב-Degas House B&amp;B, אנו בגאווה נותנים לאנשים חוויה תרבותית אותנטית בניו אורלינס. אם אתם מחפשים מקום וינטג&#39; ויפה לשהות בו, אנחנו לא יכולים להמליץ ​​מספיק על החדרים שלנו. עם זאת נאמר, ובכל מקום שתאמר, אנחנו רוצים לוודא שאתה מטפל בעצמך מהרגע שאתה קם. אין דבר טוב יותר מאשר להתחיל את היום עם ארוחה טעימה וכוס קפה מהביל. הגיע הזמן שתטעמו מהטוב ביותר שיש לניו אורלינס להציע.</pre>', 1, 0, 2, '2022-10-21 11:42:16', '2022-12-02 04:53:58'),
(42, 'ICC T20 World Cup 2022', 'كأس العالم ICC T20', 'גביע העולם ICC T20', 'sports, physical contests pursued for the goals and challenges they entail. Sports are part of every culture past and present, but each culture has its own definition of sports', 'الرياضة ، والمسابقات البدنية التي تسعى لتحقيق الأهداف والتحديات التي تنطوي عليها. تعد الرياضة جزءًا من كل ثقافة في الماضي والحاضر ، ولكن لكل ثقافة تعريفها الخاص للرياضة', 'ספורט, תחרויות פיזיות שנרדפו למען המטרות והאתגרים שהם כרוכים בהם. ספורט הוא חלק מכל תרבות בעבר ובהווה, אבל לכל תרבות יש הגדרה משלה לספורט', '<p><strong>sports</strong>, physical contests pursued for the goals and challenges they entail. Sports are part of every&nbsp;<a href=\"https://www.merriam-webster.com/dictionary/culture\">culture</a>&nbsp;past and present, but each culture has its own definition of sports. The most useful definitions are those that clarify the relationship of sports to&nbsp;<a href=\"https://www.britannica.com/topic/play-behaviour\">play</a>, games, and contests. &ldquo;Play,&rdquo; wrote the German theorist Carl Diem, &ldquo;is purposeless activity, for its own sake, the opposite of work.&rdquo; Humans work because they have to; they play because they want to. Play is autotelic&mdash;that is, it has its own goals. It is voluntary and uncoerced.&nbsp;<a href=\"https://www.merriam-webster.com/dictionary/Recalcitrant\">Recalcitrant</a>&nbsp;children compelled by their parents or teachers to compete in a game of football (soccer) are not really engaged in a sport. Neither are professional athletes if their only motivation is their paycheck. In the real world, as a practical matter, motives are frequently mixed and often quite impossible to determine. Unambiguous definition is nonetheless a prerequisite to practical determinations about what is and is not an example of play.<strong>&nbsp;&nbsp;</strong></p>\r\n\r\n<p><strong>&nbsp;<img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1667550165download (1).jpg\" style=\"border-style:solid; border-width:5px; height:168px; width:300px\" /></strong><br />\r\n&nbsp;</p>', '<pre>\r\nالرياضة ، والمسابقات البدنية التي تسعى لتحقيق الأهداف والتحديات التي تنطوي عليها. تعد الرياضة جزءًا من كل ثقافة في الماضي والحاضر ، ولكن لكل ثقافة تعريفها الخاص للرياضة. التعريفات الأكثر فائدة هي تلك التي توضح علاقة الرياضة باللعب والألعاب والمسابقات. كتب المنظر الألماني كارل ديم: &quot;اللعب هو نشاط بلا هدف ، في حد ذاته ، هو عكس العمل&quot;. يعمل البشر لأنهم مضطرون لذلك ؛ يلعبون لأنهم يريدون ذلك. اللعب تلقائي - أي أن له أهدافه الخاصة. إنه طوعي وبدون إكراه. إن الأطفال المتمردين الذين يجبرهم آباؤهم أو مدرسوهم على المنافسة في لعبة كرة القدم (كرة القدم) لا يشاركون حقًا في رياضة. كلا الرياضيين ليسوا محترفين إذا كان دافعهم الوحيد هو رواتبهم. في العالم الحقيقي ، من الناحية العملية ، غالبًا ما تكون الدوافع مختلطة وغالبًا ما يكون من المستحيل تحديدها. التعريف الواضح هو مع ذلك شرط أساسي لاتخاذ قرارات عملية حول ما هو وما هو ليس مثالاً على اللعب.</pre>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1667542867download (1).jpg\" style=\"border-style:solid; border-width:5px; height:168px; width:300px\" />&nbsp;</strong></p>', '<pre>\r\nספורט, תחרויות פיזיות שנרדפו למען המטרות והאתגרים שהם כרוכים בהם. ספורט הוא חלק מכל תרבות בעבר ובהווה, אבל לכל תרבות יש הגדרה משלה לספורט. ההגדרות השימושיות ביותר הן אלו שמבהירות את הקשר של ספורט למשחק, משחקים ותחרויות. &quot;משחק&quot;, כתב התיאורטיקן הגרמני קרל דים, &quot;הוא פעילות חסרת תכלית, לשמה, ההיפך מעבודה&quot;. בני אדם עובדים כי הם חייבים; הם משחקים כי הם רוצים. המשחק הוא אוטוטלי - כלומר, יש לו מטרות משלו. זה מרצון ולא כפוי. ילדים סוררים שנאלצו על ידי הוריהם או מוריהם להתחרות במשחק כדורגל (כדורגל) לא ממש עוסקים בספורט. גם לא ספורטאים מקצועיים אם המוטיבציה היחידה שלהם היא המשכורת שלהם. בעולם האמיתי, כעניין מעשי, המניעים הם לעתים קרובות מעורבים ולעתים קרובות די בלתי אפשרי לקבוע. הגדרה חד משמעית היא בכל זאת תנאי מוקדם לקביעות מעשיות לגבי מה הוא ומה אינו דוגמה למשחק.</pre>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img alt=\"\" src=\"http://15.207.152.121/smartapp/public/uploads/blog/1667542867download (1).jpg\" style=\"border-style:solid; border-width:5px; height:168px; width:300px\" /></strong></p>', 1, 2, 0, '2022-11-04 06:22:35', '2022-11-30 12:23:38'),
